public DriveTrain() {
    driveSystem.setDeadband(0.1);
}

public void arcadeDrive(Joystick joystick) {
    double forwardPower = joystick.getRawAxis(1) * -1;
    double turnPower = joystick.getRawAxis(2) * -0.8;
    driveSystem.arcadeDrive(forwardPower, turnPower);
}

